import React, { Component } from "react";
import {
  AiFillFacebook,
  AiFillInstagram,
  AiFillLinkedin,
  AiFillTwitterSquare,
} from "react-icons/ai";

class Footer extends Component {
  state = {};
  render() {
    return (
      <div>
        <div className="social-container">
          <div className="peos">
            <a className="social">
              <AiFillFacebook
                size={30}
                style={{
                  color: "#4968ad",
                }}
              />
            </a>
            <a className="social">
              <AiFillInstagram
                size={30}
                style={{
                  color: "black",
                }}
              />
            </a>
            <a className="social">
              <AiFillTwitterSquare
                size={30}
                style={{
                  color: "#49a1eb",
                }}
              />
            </a>

            <a className="social">
              <AiFillLinkedin
                size={30}
                style={{
                  color: "blue",
                }}
              />
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default Footer;
